import React from 'react';
import { Box, Button, Container, Typography, Grid, Paper } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/authContext';

const HeroSection = () => {
  const navigate = useNavigate();
  const { user } = useAuth();

  return (
    // ✅ This is the main container for the Hero Section
    <Box
      sx={{
        py: 8,
        position: 'relative', // Needed for overlay
        borderRadius: 1,
        // ✅ Background image styling
        backgroundImage: 'linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(/images/laundry_illustration.jpg)',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        color: '#ffffff', // Set text color to white for better contrast
      }}
    >
      <Container maxWidth="md" sx={{ textAlign: 'center', position: 'relative', zIndex: 2 }}>
        <Typography variant="h2" gutterBottom sx={{ fontWeight: 700 }}>
          Your Local <span style={{ color: 'var(--accent-primary)' }}>Laundry</span> Service
        </Typography>
        <Typography variant="h6" paragraph>
          Get premium laundry and dry cleaning delivered right to your doorstep.
        </Typography>
        <Box sx={{ mt: 4 }}>
          {user ? (
            <>
              <Button
                variant="contained"
                size="large"
                sx={{ mr: 2, backgroundColor: 'var(--accent-primary)', '&:hover': { backgroundColor: 'var(--accent-secondary)' } }}
                onClick={() => navigate('/order/new')}
              >
                Place New Order
              </Button>
              <Button
                variant="outlined"
                size="large"
                sx={{ color: '#ffffff', borderColor: '#ffffff', '&:hover': { backgroundColor: 'rgba(255, 255, 255, 0.1)'} }}
                onClick={() => navigate('/track')}
              >
                Track Your Order
              </Button>
            </>
          ) : (
            <>
              <Button
                variant="contained"
                size="large"
                sx={{ mr: 2, backgroundColor: 'var(--accent-primary)', '&:hover': { backgroundColor: 'var(--accent-secondary)' } }}
                onClick={() => navigate('/login')}
              >
                Login
              </Button>
              <Button
                variant="outlined"
                size="large"
                sx={{ color: '#ffffff', borderColor: '#ffffff', '&:hover': { backgroundColor: 'rgba(255, 255, 255, 0.1)'} }}
                onClick={() => navigate('/register')}
              >
                Register
              </Button>
            </>
          )}
        </Box>
      </Container>
    </Box>
  );
};

const FeatureCard = ({ title, description }) => (
  <Grid item xs={12} sm={6} md={4}>
    <Paper
      elevation={3}
      sx={{
        p: 3,
        textAlign: 'center',
        bgcolor: 'var(--bg-secondary)',
        color: 'var(--text-primary)',
        border: '1px solid var(--border-color)'
      }}
    >
      <Typography variant="h6" gutterBottom sx={{ fontWeight: 600 }}>
        {title}
      </Typography>
      <Typography variant="body2" color="var(--text-secondary)">
        {description}
      </Typography>
    </Paper>
  </Grid>
);

const FeaturesSection = () => {
  const features = [
    { title: 'Convenient Pickup & Delivery', description: 'Schedule your laundry online and we’ll handle the rest.' },
    { title: 'Professional Cleaning', description: 'Our expert team ensures your clothes are cleaned to the highest standards.' },
    { title: 'Affordable Pricing', description: 'Get premium laundry services without breaking the bank.' },
  ];

  return (
    <Container sx={{ py: 6 }}>
      <Typography variant="h5" align="center" gutterBottom sx={{ fontWeight: 600 }}>
        Why Choose Us?
      </Typography>
      <Grid container spacing={3} sx={{ mt: 2 }}>
        {features.map((feature, index) => (
          <FeatureCard key={index} title={feature.title} description={feature.description} />
        ))}
      </Grid>
    </Container>
  );
};

const Home = () => (
  <Box>
    <HeroSection />
    <FeaturesSection />
  </Box>
);

export default Home;
